inp = inp.split()

def part1():       
	matrix = [ [1,2,3],
	           [4,5,6],
	           [7,8,9]]
	dirs = dict(zip("UDLR", (-1, 1, -1j, 1j)))
	res, start, r, c = [], 1+1j, 1, 1
	for line in inp:
		#start = sum([dirs[d] for d in line], start)
		for di in [dirs[d] for d in line]:
			start += di
			r, c = int(start.real), int(start.imag)
			r, c = min(max(r, 0), 2), min(max(c, 0), 2)
			start = r + (c*1j)
		res.append(matrix[r][c])
	print(''.join(map(str, res)))

def part2():
    matrix = ["       ", "    1   ", "  234  ", " 56789 ", "  ABC  ", "   D   ",  "       "]
    dirs = dict(zip("DULR", (1, -1,-1j,+1j)))
    res, start, r, c = [], 3+1j, 3, 1
    for line in inp:
        for mag in [dirs[d] for d in line]:
            temp = start + mag
            r, c = int(temp.real), int(temp.imag)
            if matrix[r][c] != ' ':
                start = temp
        r, c = int(start.real), int(start.imag)
        res.append(matrix[r][c])
    print("".join(res))
  
  
part2()